import React from 'react';
import { Grid } from '@material-ui/core';

import Product from './Product/Product';


const products = [
    { id: 1, name: 'Fall with Grapes', description: 'Fall decorations with grapes.', price: '$25', image: 'https://lh3.googleusercontent.com/LSWSgdKuzMAf6lH73r-PJ7ZQm27S8jYxc46tozpR_-SEiCZ4fBAVNITJgsI0_1vsESWH=s85'},
    { id: 2, name: 'Half a Moon', description: 'Half decorated wreath.', price: '$50', image: 'https://lh3.googleusercontent.com/ttzfc3eGdLmBlJgxwX925w0gEO5sK1zzeLrY_swPry5ypaRfvTWhUYNbvrbIvC1cVhb-GA=s87' },
    { id: 3, name: 'Bow Angel', description: 'Big bow decrotaed wreath.', price: '$75', image: 'https://lh3.googleusercontent.com/oNnyRIFJ8U-8PxdY_7W67S-KCIpRtEi__RwEJpAOecaF-yeVl3aNLhaHD9IP4xlAnZr2go8=s85' },
    { id: 4, name: 'The N Wreath', description: 'The letter N decorated Wreath.', price: '$100', image: 'https://lh3.googleusercontent.com/XqP-BEvAsp7H7tD39KhA-eRx7G2vZ-6-VOaBhSPGIHObHSTPVriuS80QcswOAuyksqoypA=s85'},


];

const Products = () => {
    return (
        <main>
            <Grid container justify="center" spacing={4}>
                {products.map((product) => (
                    <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}>
                        <Product product={product} />
                    </Grid>
                ))}
            </Grid>
        </main>
    );
}

export default Products;
